import {url} from '../App';
import {useNavigate} from 'react-router-dom';

function Signout(){
  let navigate = useNavigate();
  // logout user
  const handleLogout = () => {
    localStorage.clear();
    navigate("");
  };

  const goBack = () =>{
    navigate(-1);
  };

  return (
    <div className='card'>
      <p>Are you sure you want to sign out?</p>
      <button className='btn btn--alt'onClick={goBack}>No</button>
      <button className='btn btn--alt' onClick={() => navigate(-1)}>Yes, sign out.</button>
    </div>
  )
}

export default Signout;
